import React from "react";
import "../styles/Home.css";

function Home() {
  return (
    <div className="home-container">
      <h1>Hey there, I'm</h1>
      <h2>Jose Chemmanoor</h2>
      <p className="animated-text">UI/UX Designer | Student | Front-End Developer</p>
    </div>
  );
}

export default Home;
